/* istanbul ignore file */
/* tslint:disable */
/* eslint-disable */
import type { Dataset } from '../models/Dataset';
import type { DatasetAppendRequest } from '../models/DatasetAppendRequest';
import type { DatasetMetadataInit } from '../models/DatasetMetadataInit';
import type { DatasetStatus } from '../models/DatasetStatus';
import type { CancelablePromise } from '../core/CancelablePromise';
import { request as __request } from '../core/request';

export class DatasetService {

    /**
     * List Dataset
     * @returns Dataset Successful Response
     * @throws ApiError
     */
    public static listDatasetDatasetGet(): CancelablePromise<Array<Dataset>> {
        return __request({
            method: 'GET',
            path: `/dataset`,
        });
    }

    /**
     * Create Dataset
     * @param requestBody
     * @returns Dataset Successful Response
     * @throws ApiError
     */
    public static createDatasetDatasetPost(
        requestBody: DatasetMetadataInit,
    ): CancelablePromise<Dataset> {
        return __request({
            method: 'POST',
            path: `/dataset`,
            body: requestBody,
            mediaType: 'application/json',
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Upload Yolo Dataset
     * @param datasetId
     * @param formData
     * @returns Dataset Successful Response
     * @throws ApiError
     */
    public static uploadYoloDatasetDatasetDatasetIdYoloPut(
        datasetId: string,
        formData: {
            file: Blob;
        },
    ): CancelablePromise<Dataset> {
        return __request({
            method: 'PUT',
            path: `/dataset/${datasetId}/yolo`,
            formData: formData,
            mediaType: 'multipart/form-data',
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Append To Dataset
     * @param datasetId
     * @param requestBody
     * @returns Dataset Successful Response
     * @throws ApiError
     */
    public static appendToDatasetDatasetDatasetIdPut(
        datasetId: string,
        requestBody: DatasetAppendRequest,
    ): CancelablePromise<Dataset> {
        return __request({
            method: 'PUT',
            path: `/dataset/${datasetId}`,
            body: requestBody,
            mediaType: 'application/json',
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Delete Dataset
     * @param datasetId
     * @returns void
     * @throws ApiError
     */
    public static deleteDatasetDatasetDatasetIdDelete(
        datasetId: string,
    ): CancelablePromise<void> {
        return __request({
            method: 'DELETE',
            path: `/dataset/${datasetId}`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Dataset Status
     * @param datasetId
     * @returns DatasetStatus Successful Response
     * @throws ApiError
     */
    public static datasetStatusDatasetDatasetIdStatusGet(
        datasetId: string,
    ): CancelablePromise<DatasetStatus> {
        return __request({
            method: 'GET',
            path: `/dataset/${datasetId}/status`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

}
